import React, { useState } from 'react';
import { Button } from '../ButtonElements';

import Video from '../../videos/video.mp4';
import Icon1 from '../../images/future_text_logo.png';
import Grad from '../../images/grad_pic.JPG';
import {
  HeroContainer,
  HeroBg,
  VideoBg,
  HeroContent,
  HeroIcon,
  HeroP,
  HeroBtnWrapper,
  ArrowForward,
  ArrowRight,
  photo_card,
  HeroH1,
  Education,
  HeroH2,
  EducationIcon,
  education_card_top,
  HeroH4
} from './HeroElements';

function HeroSection() {
  const [hover, setHover] = useState(false);

  const onHover = () => {
    setHover(!hover);
  };
  return (
    <HeroContainer id='home'>
      <HeroBg>
        <VideoBg playsInline autoPlay loop muted src={Video} type='video/mp4' />
      </HeroBg>
      <HeroH1>
        About
      </HeroH1>
      <HeroContent>
        <PhotoCard>
          <EducationIcon src={Grad}></EducationIcon>
          <HeroH2>Isse H Nur</HeroH2>
        </PhotoCard>
        <Education>
          <EducationCardTop>
            <HeroH4>Bachelor Of Science</HeroH4>
            <HeroH4>In Computer Science</HeroH4>
            <HeroH4>w/ Minor in Mathematics</HeroH4>
            <HeroH2>Education</HeroH2>
          </EducationCardTop>
          <EducationCardBottom>
            <HeroH4>Phi Theta Kappa Honors Society</HeroH4>
            <HeroH2>Awards</HeroH2>
          </EducationCardBottom>
        </Education>
      </HeroContent>
    </HeroContainer>
  );
}

export default HeroSection;
